all['100~149']=0;
all['150~199']=0;
all['200+']=0;

function summary()
{
    echo "$gotResponse/$total  NOERROR:$noerror  REFUSED:$refused  SERVFAIL:$servfail"
}

function stats()
{
    queryTime="$1"
    numREX='^[0-9]+$'
    if ! [[ "$queryTime" =~ $numREX ]] ; then
       return
    fi

    if (( queryTime>=0 && queryTime<19 )); then
        (( all['0~19']++ ))
    elif (( queryTime>=20 && queryTime<49 )); then
        (( all['20~49']++ ))
    elif (( queryTime>=50 && queryTime<99 )); then
        (( all['50~99']++ ))
    elif (( queryTime>=100 && queryTime<149 )); then
        (( all['100~149']++ ))
    elif (( queryTime>=150 && queryTime<199 )); then
        (( all['150~199']++ ))
    elif (( queryTime>=200 )); then
        (( all['200+']++ ))
    fi
}

function statistics()
{
    printf  " 0~19    : %s \n" "$(( all['0~19']  ))"
    printf  " 20~49   : %s \n" "$(( all['20~49'] ))"
    printf  " 50~99   : %s \n" "$(( all['50~99'] ))"
    printf  " 100~149 : %s \n" "$(( all['100~149'] ))"
    printf  " 150~199 : %s \n" "$(( all['150~199'] ))"
    printf  " 200+    : %s \n" "$(( all['200+'] ))"
}

function usage()
{
    echo "Usage: $0 www.example.com"
}

if [ -z "$domainName" ] ; then
    echo "invalid domain name";
    usage
    exit 1;
fi

for i in ${!localIPAddress[@]}; do
    [ $(( $total % 10 )) -eq 0 ] && summary
    (( total++ ))
    feedback="$( dig +time=1 +tries=1 +nocmd +answer +comment +stat +noauthority +noadditional +noquestion $domainName IN $rtype @${localIPAddress[i]} )"
    echo "$feedback" | grep -F 'Got answer' >/dev/null 2>&1
    if [ $? -eq 0 ]; then
        (( gotResponse++ ));
    else
        continue
    fi
    echo "$feedback" | grep -F 'REFUSED' >/dev/null 2>&1
    if [ $? -eq 0 ]; then
        (( refused++ ));
        continue
    fi
    echo "$feedback" | grep -F 'SERVFAIL' >/dev/null 2>&1
    if [ $? -eq 0 ]; then
        (( servfail++ ));
        continue
    fi
    echo "$feedback" | grep -F 'NOERROR' >/dev/null 2>&1;
    if [ $? -eq 0 ]; then
        (( noerror++ ));
        while read -r line; do
            echo "$line" | grep '^;; Query time:' >/dev/null 2>&1
            if [ $? -eq 0 ]; then
                latency=$( echo "$line" | grep -Po '[[:digit:]]*' );
                echo "-----------${localIPAddress[i]}   $latency  msec -------------------"
                stats $latency
                break;
            fi
        done <<< "$feedback"
        while read -r line; do
            echo "$line" | grep -Ev '^;.*$|^$'
        done <<< "$feedback"
    fi
done
echo "--------------------DONE----------------------------"
summary
statistics
